  selector: 'app-estudiantes-list',
  templateUrl: './estudiantes-list.component.html',
  styleUrls: ['./estudiantes-list.component.css']
})
export class EstudiantesListComponent implements OnInit {

  estudiantes: Estudiante[] = [
    {
      id:1,
      nombre:'Ricardo',
      apellido:'Martinez',
      edad:25,
      genero:'Masculino'
    },
    {
      id:2,
      nombre:'Juan Pablo',
      apellido:'Lopez',
      edad:25,
      genero:'Masculino'
    },
    {
      id:3,
      nombre:'Romina',
      apellido:'Salazar',
      edad:15,
      genero:'Femenino'
    },
    {
      id:4,
      nombre:'Oscar',
      apellido:'Pafloxci',
      edad:35,
      genero:'Masculino'
    },
    {
      id:5,
      nombre:'Sandra',
      apellido:'Bulock',
      edad:40,
      genero:'Femenino'
    }

  ];

  constructor(){}

  ngOnInit():void{

    this.estudiantes.push();
  }



}
